  static async getInitialProps() {

    return { posts: "data" }
  }

  render() {
    return (
      <div className="page-wrapper">
        <div className="app-container">
          <div className="column">

          </div>
          <div className="column">

          </div>
        </div>
        <style jsx>{`
          .app-container {
            background-color: #fff;
            width: 500pt;
            height: 400px;
            padding-left: 10pt;
            padding-right: 10pt;
            padding-top: 20pt;
            border-radius: 10px;
            box-shadow: 0px 0px 40px rgba(0,0,0,0.1);
            display: flex;
            flex-direction: row;
            height: 100%;
          }
          .column {
            box-sizing: border-box;
            width: 50%;
            height: 100%;
          }
          .column:first-child {
            background: red;
          }
        `}</style>
        <style jsx global>{`
          body, html {
            width: 100%;
            height: 100%;
            margin: 0;
            background-color: #fff176;
            display: flex;
            align-items: center;
            justify-content: center;
            color: #333;
          }
        `}</style>
      </div>
    )
  }
}

export default Index
